package qwert.testFealds.testDataFealds;import com.fasterxml.jackson.annotation.JsonProperty;public class DataFields {    @JsonProperty("id")    private Integer id;    @JsonProperty("name")    private String name;    @JsonProperty("year")    private Integer year;    @JsonProperty("color")    private String color;    @JsonProperty("pantone_value")    private String pantone_value;    public String getColor() {        return color;    }    public Integer getId() {        return id;    }    public String getName() {        return name;    }    public String getPantone_value() {        return pantone_value;    }    public Integer getYear() {        return year;    }    public DataFields(String color, Integer id, String name, String pantone_value, Integer year) {        this.color = color;        this.id = id;        this.name = name;        this.pantone_value = pantone_value;        this.year = year;    }    public DataFields(){}}